import React from "react";
import { Button, Col } from "react-bootstrap";
import '../../layout/LoginLayout/LoginLayout.css';

function ButtonSocials({ label, className, onClick }) {
  return (
    <Col xs={3} className="text-center">
      <Button className={`bg-dark w-100 container-socials ${className}`} onClick={onClick}>
        <h1>{label}</h1>
      </Button>
    </Col>
  );
}

export default ButtonSocials;
